import React from "react";

function ProjectCard({data}) {
  return (
    <>
    <div className="w-50 h-50 bg-dark" >

      <div className="container text-light p-5 bg-secondary">
        <p>{data.pName}</p>
      </div>
    </div>
    </>
  );
}

export default ProjectCard;
